import React from "react";
import "./topfold.css";

function TopFold() {
  return (
    <div className="topfold">
      <div className="home-topfold">
        <div className="searchbar">
          <i class="fas fa-search"></i>
          <input
            placeholder="Search for expenses"
            value=""
            onChange={() => console.log("Searched")}
          ></input>
        </div>
      </div>
    </div>
  );
}

export default TopFold;
